		public static readonly string One =
			"D̴r̶.̴ ̵W̴e̶n̴g̵e̷l̸ ̸M̷a̷y̸ ̴1̵6̶,̶ ̴1̸9̸9̵5̶\r\n̶E̶x̷p̸e̸r̵i̶m̵e̶n̸t̶:̴\r\n̸V̵o̵l̴o̵n̸\r\n̷\r\n̵\r\n̶I̸N̶T̸R̶O̷D̷U̸C̶T̶I̴O̷N̶\r\n̵L̵i̴g̷h̸t̷ ̴i̵s̶ ̴a̶ ̸c̴o̵l̵l̶e̸c̵t̶i̷o̴n̸ ̸o̵f̴ ̶p̵h̷o̵t̶o̶s̵ ̵t̷h̶a̴t̸ ̸t̵r̵a̷v̵e̸l̴ ̶i̸n̶ ̶a̷ ̴s̵t̷r̷a̵i̵g̸h̶t̶ ̶l̸i̵n̷e̸.̸\r\n̷P̷h̵o̸t̶o̴n̴s̵ ̷a̷r̷e̶ ̷e̴x̷t̵r̵e̶m̶e̵l̷y̵ ̶s̴m̶a̵l̸l̶ ̵a̸n̶d̵ ̸m̵o̵v̸e̷ ̴a̷t̶ ̸t̸h̶e̴ ̸f̴a̴s̴t̵e̵s̴t̸ ̴s̴p̵e̶e̸d̴ ̴i̶n̴ ̵t̴h̷e̴ ̶u̴n̴i̶v̷e̴r̸s̶e̵.̴\r\n̵H̷o̷w̷e̸v̷e̸r̷,̷ ̶p̸h̵o̴t̵o̷s̸ ̵c̷a̵n̴ ̴a̴c̷t̶ ̸b̷o̴t̴h̵ ̴a̸s̸ ̸a̴ ̸p̵a̵r̴t̸i̴c̷l̵e̵ ̵a̵n̵d̸ ̶a̷s̸ ̵a̷ ̴w̶a̵v̵e̵.̶\r\n̸W̴a̷v̸e̵s̶ ̸o̸f̶ ̶l̵i̵g̶h̵t̵ ̶c̸a̷n̷ ̸h̴a̸v̵e̴ ̸d̸i̴f̴f̴e̷r̶e̵n̵t̵ ̶f̷r̵e̷q̶u̸e̶n̶c̶i̸e̵s̵,̸ ̴c̵r̶e̴a̶t̷i̴n̸g̵ ̴d̵i̷f̸f̷e̶r̶e̸n̷t̸ ̵c̸o̴l̴o̴r̷s̴.̴\r\n̸T̵h̷i̴s̶ ̵e̸x̸p̵e̸r̵i̸m̶e̴n̵t̴ ̵w̸i̸l̶l̵ ̷f̵o̸c̷u̴s̴ ̶o̶n̷ ̶a̸ ̵s̸p̶e̸c̵i̶a̷l̶ ̴l̴i̷g̷h̷t̵ ̵t̸h̶a̵t̵ ̶e̴x̸i̶s̶t̸ ̷i̷n̴ ̴b̸e̷t̶w̶e̸e̴n̴ ̴w̴a̴v̸e̵l̸e̸n̷g̶t̴h̷s̸,̷ ̶c̸a̵l̶l̸e̵d̴ ̷S̷p̴e̸c̸t̶r̷a̸l̵ ̴F̴r̷e̵q̴u̴e̷n̴c̶i̵e̴s̵.̴\r\n̴\r\n̷P̶R̴O̴C̴E̷D̷U̷R̴E̷S̴\r\n̶T̷h̸e̵ ̵e̴x̷p̴e̵r̷i̶m̷e̸n̸t̵ ̷i̸s̴ ̵d̸e̴s̷i̶g̶n̶e̴d̵ ̶t̴o̵ ̵t̵e̴s̵t̴ ̸t̷h̴e̸ ̵e̸f̸f̴e̵c̸t̵ ̷ ̸o̷f̶ ̴S̶p̵e̶c̷t̷r̷a̶l̵ ̶F̶r̷e̵q̸u̸e̴n̷c̵i̶e̵s̴ ̷o̶n̴ ̴t̷h̶e̷ ̷h̴u̵m̷a̶n̷ ̶e̵y̶e̷.̸\r\n̸F̷i̵r̴s̴t̷,̷ ̷a̷ ̸t̵e̶s̴t̷ ̸s̵u̴b̶j̷e̸c̸t̵ ̴i̶s̵ ̵p̶l̷a̷c̶e̶d̴ ̴i̸n̴ ̴a̴ ̵s̴e̴a̶l̶e̷d̶ ̶r̸o̴o̷m̴ ̴w̵i̸t̷h̷ ̶n̸o̶ ̷l̶i̷g̴h̸t̶i̴n̴g̶.̶\r\n̶A̵ ̶c̵a̵m̷e̷r̶a̸ ̴a̸n̶d̵ ̴S̷p̴e̶c̴t̷r̴a̵l̶ ̸F̸r̶e̸q̵u̶e̸n̸c̵y̶ ̶s̶o̶u̸r̴c̶e̴ ̴a̶r̶e̴ ̷p̴l̷a̶c̷e̷d̶ ̴1̷.̸5̸ ̷m̶e̶t̴e̷r̷s̵ ̸f̵r̴o̷m̸ ̵t̸h̶e̶ ̸s̵u̶b̶j̷e̷c̵t̴.̸\r\n̸T̴h̴e̶ ̴s̶u̴b̶j̸e̸c̴t̴'̷s̵ ̶p̷a̷i̷n̶ ̶r̷e̸c̷e̵p̸t̷o̶r̵s̵ ̷a̶r̸e̶ ̶p̷r̶i̸m̸e̵d̴ ̷w̷i̵t̴h̷ ̸l̵i̷g̵h̶t̷ ̴e̷l̴e̵c̶t̶r̵i̴c̷a̵l̴ ̵s̴h̴o̵c̷k̸s̵.̷\r\n̵\r\n̸E̴X̴P̷E̷R̴I̴M̵E̵N̸T̸\r\n̴\r\n̴S̴E̶C̵T̶I̶O̴N̵ ̵1̸\r\n̶E̶l̴e̴c̶t̵r̶i̴c̴a̴l̷ ̵P̶r̶i̷m̶i̷n̶g̴\r\n̴T̵h̶e̴ ̶f̶o̷l̵l̵o̴w̴i̴n̵g̶ ̶i̸m̵a̵g̵e̷s̴ ̴w̶e̸r̷e̸ ̴t̸a̷k̶e̷n̶ ̶i̵n̵ ̷s̶e̵q̶u̶e̶n̴c̴e̵ ̸d̷u̸r̴i̷n̷g̵ ̴t̴h̸e̷ ̴e̶l̷e̸c̸t̶r̵i̷c̸a̵l̸ ̷p̸r̴i̷m̴i̶n̸g̴ ̵s̷t̷a̵g̴e̵ ̴o̷f̸ ̶t̵h̵e̵ ̴e̵x̸p̶e̵r̶i̵m̶e̵n̴t̶.̷\r\n̵\r\n̴S̵E̵C̴T̴I̵O̶N̴ ̴2̴\r\n̷E̵x̶p̵o̴s̶u̴r̵e̷\r\n̴T̴h̴e̸ ̸f̸o̶l̸l̸o̷w̴i̶n̶g̶ ̷i̷m̶a̵g̴e̸s̴ ̴w̴e̷r̶e̶ ̸t̵a̷k̷e̷n̷ ̷i̸n̸ ̸s̶e̴q̶u̴e̶n̵c̴e̴